INSERT INTO `xm_admin_cartoon` VALUES (12, '一拳超人', '1580971087/20200206/0337e167c330bbcc61c1393975041f9c.jpg', '讲述的是主人公埼玉原本是一名整日奔波于求职的普通人。三年前的一天偶然遇到了要对淘气少年下杀手的异变螃蟹人后，回忆起年少年时“想要成为英雄”的梦想，最终拼尽全力救下了淘气少年。重拾对于成为英雄的兴趣之后，通过拼命锻炼，埼玉终于脱胎换骨获得了最强的力量，但同时失去了头发成了光头，似乎还失去了某些感情。\n埼玉在独自做了一段时间英雄后，与弟子杰诺斯一起，正式加入英雄协会，与众多英雄一起开始了对抗各种怪人以及灾难的生活。不过经常是在无人知晓的情况下做英雄的工作。', 0, '1580819885', '1580971090', '1580892522', 0, 0, 1);
INSERT INTO `xm_admin_cartoon` VALUES (14, '英雄学院', '1580971105/20200206/13d9d342ebb4232092e1c4b09c1e6a1b.jpg', '大部分的人类，在这个时代里都拥有名为“个性”的力量，但有力量之人却不一定都属于正义的一方。只要邪恶出现的地方，必定会有英雄挺身而出拯救众人。一名天生没有力量的少年——绿谷出久从小就憧憬一位顶尖英雄，而他的梦想就是成为伟大的英雄，可是，没有力量的他能实现自己的梦想吗？虽然困难重重，少年却依旧不放弃，朝着自己的目标勇往前进！', 0, '1580967471', '1580971107', '1580967498', 0, 0, 1);
INSERT INTO `xm_admin_cartoon` VALUES (15, '火影忍者', '1580968773/20200206/87e3e568c701f4eb7550f4567105fb72.jpg', 'nihao1a1', 0, '1580968791', '1580970654', '1580970654', 1, 0, 1);
